import{e as a}from"./app.9aca45ba.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const e={},p=a('<h1 id="_3\u110C\u1161\u11BC-\u1112\u1161\u11B7\u1109\u116E" tabindex="-1"><a class="header-anchor" href="#_3\u110C\u1161\u11BC-\u1112\u1161\u11B7\u1109\u116E" aria-hidden="true">#</a> 3\uC7A5. \uD568\uC218</h1><h2 id="\u1112\u1161\u11B7\u1109\u116E\u1102\u1173\u11AB-\u110C\u1161\u11A8\u1100\u1166-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110B\u1165\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11B7\u1109\u116E\u1102\u1173\u11AB-\u110C\u1161\u11A8\u1100\u1166-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110B\u1165\u1105\u1161" aria-hidden="true">#</a> \uD568\uC218\uB294 \uC791\uAC8C \uB9CC\uB4E4\uC5B4\uB77C</h2><p>\uD568\uC218\uB294 \uC791\uAC8C \uB9CC\uB4E4\uC218\uB85D \uC88B\uB2E4.</p><p>\uB610\uD55C \uD55C \uAC00\uC9C0\uC758 \uAE30\uB2A5\uB9CC \uD558\uB294 \uAC83\uC774 \uC88B\uB2E4.</p><p><strong>\uB300\uC2E0 \uADF8 \uD55C\uAC00\uC9C0\uB97C \uC798\uD558\uC790.</strong></p><p>\uC0AC\uC2E4 \uD568\uC218\uC5D0\uC11C \uD55C\uAC00\uC9C0 \uAE30\uB2A5\uB9CC \uC218\uD589\uD558\uB354\uB77C\uB3C4, \uBCF4\uB294 \uAD00\uC810\uC5D0 \uB530\uB77C \uC5EC\uB7EC\uAC00\uC9C0 \uC77C\uC744 \uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD560 \uC218\uB3C4 \uC788\uB2E4.</p><p>\uC815 \uBAA8\uB974\uACA0\uB2E4\uBA74, <strong>\uD574\uB2F9 \uD568\uC218 \uC548\uC5D0\uC11C \uCD94\uC0C1\uD654\uAC00 \uB2E8\uACC4\uAC00 \uD558\uB098\uC778 \uB2E8\uACC4\uB9CC \uC218\uD589\uD558\uB294\uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uC790.</strong></p><p>\uC989, \uB4E4\uC5EC\uC4F0\uAE30 \uC218\uC900\uC744 1\uB2E8\uC774\uB098 2\uB2E8\uC744 \uB118\uAE30\uC9C0 \uC54A\uAC8C \uD558\uBA74 \uB41C\uB2E4.</p><p>3\uB2E8 \uC774\uC0C1\uC774 \uB41C\uB2E4\uBA74 \uAE30\uB2A5\uB4E4\uC744 \uD568\uC218\uB85C \uB098\uB220\uC11C \uCD94\uC0C1\uD654\uB97C \uC9C4\uD589\uD558\uC790.</p><br><h2 id="\u1102\u1162\u1105\u1167\u1100\u1161\u1100\u1175-\u1100\u1172\u110E\u1175\u11A8" tabindex="-1"><a class="header-anchor" href="#\u1102\u1162\u1105\u1167\u1100\u1161\u1100\u1175-\u1100\u1172\u110E\u1175\u11A8" aria-hidden="true">#</a> \uB0B4\uB824\uAC00\uAE30 \uADDC\uCE59</h2><p>\uCF54\uB4DC\uB294 \uC704\uC5D0\uC11C \uC544\uB798\uB85C \uB0B4\uB824\uAC00\uB294 \uC774\uC57C\uAE30\uCC98\uB7FC \uC9DC\uC790.</p><br><h2 id="\u1109\u1165\u1109\u116E\u11AF\u110C\u1165\u11A8\u110B\u1175\u11AB-\u110B\u1175\u1105\u1173\u11B7\u110B\u1173\u11AF-\u1109\u1161\u110B\u116D\u11BC\u1112\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u1109\u1165\u1109\u116E\u11AF\u110C\u1165\u11A8\u110B\u1175\u11AB-\u110B\u1175\u1105\u1173\u11B7\u110B\u1173\u11AF-\u1109\u1161\u110B\u116D\u11BC\u1112\u1161\u1105\u1161" aria-hidden="true">#</a> \uC11C\uC220\uC801\uC778 \uC774\uB984\uC744 \uC0AC\uC6A9\uD558\uB77C</h2><p>\uAE38\uC5B4\uB3C4 \uC88B\uC73C\uB2C8 \uB9D0\uC774\uB2E4!</p><br><h2 id="\u1112\u1161\u11B7\u1109\u116E-\u110B\u1175\u11AB\u110C\u1161\u1102\u1173\u11AB-2\u1100\u1162-\u110B\u1175\u1112\u1161\u1105\u1169-\u1112\u1161\u110C\u1161" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11B7\u1109\u116E-\u110B\u1175\u11AB\u110C\u1161\u1102\u1173\u11AB-2\u1100\u1162-\u110B\u1175\u1112\u1161\u1105\u1169-\u1112\u1161\u110C\u1161" aria-hidden="true">#</a> \uD568\uC218 \uC778\uC790\uB294 2\uAC1C \uC774\uD558\uB85C \uD558\uC790</h2><p>\uC81C\uBC1C!</p><br><h2 id="\u1107\u116E\u1109\u116E\u1112\u116D\u1100\u116A\u1105\u1173\u11AF-\u110B\u1175\u11AF\u110B\u1173\u110F\u1175\u110C\u1175-\u1106\u1161\u11AF\u110C\u1161" tabindex="-1"><a class="header-anchor" href="#\u1107\u116E\u1109\u116E\u1112\u116D\u1100\u116A\u1105\u1173\u11AF-\u110B\u1175\u11AF\u110B\u1173\u110F\u1175\u110C\u1175-\u1106\u1161\u11AF\u110C\u1161" aria-hidden="true">#</a> \uBD80\uC218\uD6A8\uACFC\uB97C \uC77C\uC73C\uD0A4\uC9C0 \uB9D0\uC790</h2><p>\uC774\uAC74... \uC815\uB9D0 \uD798\uB4E4\uB2E4.</p><p>1~2\uC7A5\uC5D0\uC11C \uB9AC\uD329\uD1A0\uB9C1\uC744 \uC904\uC774\uAE30 \uC704\uD574\uC11C \uCC98\uC74C\uBD80\uD130 \uAD6C\uC870\uB97C \uC81C\uB300\uB85C \uC7A1\uACE0 \uAC00\uC57C\uD55C\uB2E4\uACE0 \uD588\uB2E4.</p><p>\uAD6C\uC870\uB97C \uC7A1\uACE0, \uC5B4\uB5A4 \uAE30\uB2A5\uC744 \uB9CC\uB4E4\uC9C0 \uC0DD\uAC01\uC744 \uC548\uD558\uBA74, \uD568\uC218 \uC548\uC5D0 \uAE30\uB2A5\uB4E4\uC744 \uC6B0\uACA8\uB123\uAC8C \uB41C\uB2E4.</p><p>\uC774\uB294 \uACB0\uAD6D \uBD80\uC218\uD6A8\uACFC... \uC989 \uC0AC\uC774\uB4DC\uC774\uD399\uD2B8\uB97C \uC77C\uC73C\uD0A8\uB2E4.</p><p>\uC774\uAC83 \uB54C\uBB38\uC5D0 \uACB0\uAD6D \uB9AC\uD329\uD1A0\uB9C1\uC774 \uBC18\uBCF5\uB418\uACE0, \uBC14\uAFB8\uBA74 \uBC14\uAFC0\uC218\uB85D \uCF54\uB4DC \uC804\uCCB4\uB97C \uBC14\uAFB8\uAC8C \uB41C\uB2E4.</p><p>\uC544\uBB34\uB9AC \uD3B8\uD558\uAC8C \uCF54\uB4DC\uB97C \uC9DC\uACE0 \uC2F6\uC5B4\uB3C4 \uBD80\uC218\uD6A8\uACFC\uB294 \uC9C0\uC591\uD558\uC790.</p><br><h2 id="\u1107\u1161\u11AB\u1107\u1169\u11A8\u1112\u1161\u110C\u1175-\u1106\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u1107\u1161\u11AB\u1107\u1169\u11A8\u1112\u1161\u110C\u1175-\u1106\u1161\u1105\u1161" aria-hidden="true">#</a> \uBC18\uBCF5\uD558\uC9C0 \uB9C8\uB77C</h2><p>\uBC18\uBCF5\uD558\uC9C0 \uB9D0\uB77C\uB294 \uB9D0\uC740 \uD074\uB9B0\uD558\uAC8C \uCF54\uB4DC\uB97C \uC9DC\uB294\uAC83\uACFC \uC77C\uB9E5\uC0C1\uD1B5\uD55C\uB2E4....</p><p>\uB9AC\uD329\uD1A0\uB9C1\uC744 \uD560 \uC5EC\uC9C0\uB97C \uCD5C\uB300\uD55C \uC904\uC774\uC790.</p><p>\uB610\uD55C \uBC18\uBCF5\uC740 \uC911\uBCF5\uC744 \uC77C\uC73C\uD0AC \uD655\uB960\uB3C4 \uC788\uB2E4. \uC808\uB300! \uC870\uC2EC\uD558\uC790.</p><p><br><br><br></p><h2 id="\u1112\u116E\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1112\u116E\u1100\u1175" aria-hidden="true">#</a> \uD6C4\uAE30</h2><p>\uC804\uCCB4\uC801\uC778 \uB0B4\uC6A9\uC740 \uC774\uD574\uAC00 \uAC04\uB2E4.</p><p>\uC5B4\uCC0C\uBCF4\uBA70 1, 2\uC7A5\uC5D0\uC11C \uC124\uBA85\uD558\uACE0\uC790 \uD558\uB294 \uB0B4\uC6A9\uACFC \uB9E5\uB77D\uC774 \uD1B5\uD55C\uB2E4.</p><p>\uADF8\uC800... \uCC45\uC744 \uC77D\uC5B4\uBD10\uB3C4 \uCD94\uC0C1\uD654 \uB2E8\uACC4\uB97C \uC5B4\uB5BB\uAC8C \uC7A1\uC544\uC57C\uD560\uC9C0 \uC798 \uBAA8\uB974\uACA0\uB2E4.</p><p>\uC5B4\uB5A4 \uD568\uC218\uB294 \uCD94\uC0C1\uD654\uAC00 \uAE4A\uAC8C \uC774\uC5B4\uC9C8 \uC218\uB3C4 \uC788\uACE0, \uBE44\uC2B7\uD55C \uAE30\uB2A5\uC744 \uD558\uB294 \uBCC0\uC218\uC640 \uD568\uC218\uB294 \uC810\uC810 \uB9CE\uC544\uC9C4\uB2E4.</p><p>\uB124\uC774\uBC0D\uC740 \uBE44\uC2B7\uD55C\uAC8C \uB9CE\uC544\uC9C0\uBA74\uC11C \uC810\uC810 \uC9D3\uAE30 \uD798\uB4E4\uC5B4\uC9C0\uACE0, \uC774\uB294 \uD63C\uB3D9\uC744 \uCD08\uB798\uD55C\uB2E4.</p><p>\uC0AC\uC2E4... \uAC1C\uBC1C \uACBD\uD5D8\uC774 \uADF8\uB807\uAC8C \uB9CE\uC9C0 \uC54A\uAE30\uC5D0 \uC544\uC9C1 \uBAA8\uB974\uB294\uAC70\uB77C\uACE0\uB3C4 \uC0DD\uAC01\uD55C\uB2E4.</p><p>\uACF5\uBD80..\uACC4\uC18D \uD558\uC790.</p>',40);function h(d,i){return p}var s=r(e,[["render",h]]);export{s as default};
